import axios from "axios";

const URL = "https://openweathermap.org/data/2.5/weather";
const API_KEY = "767b06fd358752ff108abfd817818265";

export const Fetchweather = async (query) => {
  const { data } = await axios.get(URL, {
    params: {
      q: query,
      units: "metric",
      APPID: API_KEY,
    },
  });

  return data;
};
